// SPDX-License-Identifier: MIT

pragma solidity ^0.8.22;

import {ERC721Upgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import {EnumerableSetUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import {ERC721URIStorageUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import {ERC721RoyaltyUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721RoyaltyUpgradeable.sol";
import {ERC721EnumerableUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import {AdminControl} from "./AdminControl.sol";
import {Core} from "./CoreValues.sol";

abstract contract CollectionManager is
    ERC721URIStorageUpgradeable,
    ERC721RoyaltyUpgradeable,
    ERC721EnumerableUpgradeable,
    Core,
    AdminControl
{

    function mintToken(
        address to,
        string calldata uri
    ) external AdminOnly returns (uint) {
        uint newTokenId = _tokenCount + 1;

        _safeMint(to, newTokenId);
        _setTokenURI(newTokenId, uri);

        _tokenCount++;

        return newTokenId;
    }

    function setBaseUri(string calldata newBase) external onlyOwner {
        _baseTokenURI = newBase;
    }

    function _baseURI() internal view override returns (string memory) {
        return _baseTokenURI;
    }

    // fee denominator = 10000
    function setDefaultRoyalty(
        address receiver,
        uint96 numerator
    ) external AdminOnly {
        _setDefaultRoyalty(receiver, numerator);
    }

    function deleteDefaultRoyalty() external AdminOnly {
        _deleteDefaultRoyalty();
    }

    function setTokenRoyalty(
        uint tokenId,
        address receiver,
        uint96 numerator
    ) external AdminOnly {
        _setTokenRoyalty(tokenId, receiver, numerator);
    }

    function resetTokenRoyalty(uint tokenId) external AdminOnly {
        _resetTokenRoyalty(tokenId);
    }

    // function _beforeTokenTransfer(
    //     address from,
    //     address to,
    //     uint256 tokenId,
    //     uint256 batchSize
    // )
    //     internal
    //     virtual
    //     override(ERC721Upgradeable, ERC721EnumerableUpgradeable)
    // {
    //     super._beforeTokenTransfer(from, to, tokenId, batchSize);
    // }

    // // Override _burn
    // function _burn(uint256 tokenId)
    //     internal
    //     virtual
    //     override(ERC721Upgradeable, ERC721RoyaltyUpgradeable, ERC721URIStorageUpgradeable)
    // {
    //     super._burn(tokenId);
    // }

     function _increaseBalance(address account, uint128 amount) internal virtual override (ERC721Upgradeable, ERC721EnumerableUpgradeable) {
        super._increaseBalance(account, amount);
     }

    function _update(address to, uint256 tokenId, address auth) internal virtual override (ERC721Upgradeable, ERC721EnumerableUpgradeable) returns (address) {
        super._update(to, tokenId, auth);
    }

    function supportsInterface(
        bytes4 interfaceId
    )
        public
        view
        override(
            ERC721EnumerableUpgradeable,
            ERC721RoyaltyUpgradeable,
            ERC721URIStorageUpgradeable
        )
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function tokenURI(
        uint256 tokenId
    )
        public
        view
        override(
            ERC721Upgradeable, 
            ERC721URIStorageUpgradeable
        ) returns (string memory)
    {
        return super.tokenURI(tokenId);
    }
}

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.22;

import {EnumerableSetUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";

abstract contract Core {
    address internal constant FEE_DISTRIBUTION =
        0xD99ce3201D3Caa7eD099d01947312dfe86Daaa23;

    struct TokenData {
        address owner;
        string uri;
        address receivers;
        uint royalty;
    }

    string internal _name;
    string internal _symbol;
    string internal _baseTokenURI;
    uint256 internal _tokenCount;

    // Mapping from token ID to token data
    mapping(uint256 => TokenData) internal _tokenData;

    // Mapping for individual token URIs
    mapping(uint256 => string) internal _tokenURIs;

    function rando(uint max) internal view returns (uint) {
        uint random;

        random =
            (uint(
                keccak256(
                    abi.encodePacked(block.timestamp, msg.sender, _tokenCount)
                )
            ) % max) +
            1;

        return random;
    }

    function toString(bytes32 byt) internal pure returns (string memory) {
        string memory converted = string(abi.encodePacked(byt));
        return converted;
    }

    function stringToBytes32(
        string memory source
    ) internal pure returns (bytes32 result) {
        bytes memory tempEmptyStringTest = bytes(source);
        if (tempEmptyStringTest.length == 0) {
            return 0x0;
        }

        assembly {
            result := mload(add(source, 32))
        }
    }

    uint256[50] __gap;
}

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.22;

import {EnumerableSetUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import {OwnableUpgradeable} from "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

abstract contract AdminControl is OwnableUpgradeable {
    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.AddressSet;

    EnumerableSetUpgradeable.AddressSet private _admins;

    event AdminApproved(address indexed account, address indexed sender);
    event AdminRevoked(address indexed account, address indexed sender);

    modifier AdminOnly() {
        require(
            owner() == msg.sender || _admins.contains(msg.sender),
            "AdminControl: Must be owner or admin"
        );
        _;
    }

    function isAdmin(address admin) public view returns (bool) {
        return (owner() == admin || _admins.contains(admin));
    }

    function getAdmins() external view returns (address[] memory admins) {
        admins = new address[](_admins.length());
        for (uint i = 0; i < _admins.length(); i++) {
            admins[i] = _admins.at(i);
        }
        return admins;
    }

    function approveAdmin(address admin) external onlyOwner {
        if (!_admins.contains(admin)) {
            emit AdminApproved(admin, msg.sender);
            _admins.add(admin);
        }
    }

    function revokeAdmin(address admin) external onlyOwner {
        if (_admins.contains(admin)) {
            emit AdminRevoked(admin, msg.sender);
            _admins.remove(admin);
        }
    }
}

